class Batch {
    constructor(
      id = undefined,
      batchName,
      version = undefined,
      auditList,
      scenarioList,
      deltaComment = '',
      added = [],
      removed = []
    ) {
      this.id = id;
      this.batchName = batchName;
      this.version = version;
      this.auditList = auditList;
      this.scenarioList = scenarioList;
      this.deltaComment = deltaComment;
      this.added = added;
      this.removed = removed;
    }
  }
  
  export default Batch;
  